import React from "react";

export default function Listbook(props) {
  console.log(props);
  return (
    <div class="card">
      <ul class="list-group list-group-flush">
        <li class="list-group-item">{props.result[0].author}</li>
        <li class="list-group-item">A second item</li>
        <li class="list-group-item">A third item</li>
      </ul>
      <div class="card">
        <div class="card-header">Rating</div>
        <div class="card-body">
          <h5 class="card-title">{props.result[0].titre}</h5>
          <p class="card-text">{props.result[0].author}</p>
        </div>
      </div>
    </div>
  );
}
